import React from 'react';
import { Routes, Route } from 'react-router-dom';
import { Home, KeyFeatures } from './pages';
import './App.css';

function App() {
  return (
    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/key-features" element={<KeyFeatures />} />
    </Routes>
  );
}

export default App;
